script: |
  super -f text -I q6291.spq | sort > q6291.out

inputs:
  - name: q6291.spq
    data: |
      SELECT + + 84 + - ( - col2 ) AS col1 FROM tab1 (FORMAT parquet) WHERE ( NOT col1 - + col2 BETWEEN + col0 * + col0 AND + 18 + + - col1 );
  - name: tab1

outputs:
  - name: q6291.out
    data: |
      143
      152
      180
